script: [
	{
		id: "dialog_1",
		modification: {
			on_process: "[end_script(), speech_dialog(self, set(level.zoom, 2),
									set(level.player.facing, 1),
									set(level.focus, [self, level.player]),
									
									animation('mutter_begin'),
									[~So!  I've unlocked this gate, here.~],
									facing(1),
									set(level.player.animation, 'emote_oh'),
									set(level.focus, [level.player]),
					level.player,	[~Finally, a chance to use your degree...~],
									set(level.player.animation, 'emote_talk'),
									[~...Sorry.~],
									animation('emote_caneshake'),
									set(level.focus, [self]),
					self,			[~Through there,\\nis the way to where Milgram lives.~],
									animation('emote_confused'),
									[~If I remember right,\\none way to his castle will take you... hmm.~],
									animation('emote_confused'),
									[~Uh, this'll take you over a bridge,\\nthen through an underground passage.~],
									animation('mutter_begin'),
									[~Watch your head in there.~],
									animation('mutter_begin'),
									[~Past that, and you come to the forest.~],
									animation('emote_confused'),
									[~I haven't been there in a long time,\\nso I'm not sure what's become of it.~],
									animation('mutter_begin'),
									facing(-1),
									[~I'm rather out of date on my political geography,\\nso you'll just have to ask people as you go.~],
									set(level.player.animation, 'emote_confused'),
									set(level.focus, [self, level.player]),
					level.player,	[~Uhm... well, don't you have any maps or such?\\nAre you going to help outfit me for this?~],
									animation('mutter_begin'),
					self,			[~Nope.\\nYou're on your own.  Good luck.~],
									animation('mutter_begin'),
									set(level.player.animation, 'emote_geez'),
					level.player,	[~Gee, thanks.~],
									set(level.player.animation, 'emote_geez'),
					level.player,	[~Before we part ways, though,\\none question:~],
									set(level.player.animation, 'emote_oh'),
					level.player,	[~What are we planning to do about\\nthe rest of Milgram's army?~],
									set(level.focus, [get_object(level,'kinguin')]),
									set(level.player.facing, -1),
									begin_script('kinguin_walk'),
									set(get_object(level,'kinguin').animation,'walk'),
	get_object(level,'kinguin'),	[~Hey guys!~],
									set(level.focus, [level.player]),
									set(level.player.animation, 'emote_talk'),
					level.player,	[~Oh, hey there!\\nDidn't see you coming.~],
									set(level.focus, [get_object(level,'kinguin')]),
	get_object(level,'kinguin'),	[~Yeah, I couldn't help but overhear, and\\n... good news: Your problem is solved!~],
									set(level.focus, [level.player]),
									set(level.player.animation, 'emote_confused'),
					level.player,	[~What do you mean?~],
									set(level.focus, [get_object(level,'kinguin')]),
	get_object(level,'kinguin'),	[~Milgram's crew.  When that captain-guy\\ncame out of the house here,\\nthey all hopped in his airship and left.~],
									set(level.focus, [level.player]),
									set(level.player.animation, 'emote_raisedfinger'),
					level.player,	[~Amazing...  if you don't mind,\\nI have a few questions for you.~],
									animation('emote_canestomp'),
									set(level.focus, [self]),
					self,			[~Well, that settles things for me.\\nYou two have fun.~],
									
									set(get_object(level,'town_elder').animation, 'run_scared'),
									
									set(level.zoom, 1),
									set(level.focus, []),
									level.player.store_event('town_elder_post_fight_speech',1))
		
		]",
			target: "get_object(level,'town_elder')",
		},
	},
	{
